@andrestaltz
Is it possible to access ManyVerse's ssb directory from another app (e.g. Termux) or `adb`? Or does the device have to be rooted? I would like to either copy the private key or add an additional `master` key to the config, so that I could run other SSB apps on the device with #manyverse 's scuttlebot.
~cel

@mix @dan
%v2zIrO8mwnCOIiEBJQ2izcm8nedZq2sTEP4SUniQaIc=.sha256
Private blobs in our implementations are encrypted by their sha256 as the key, with zeros as nonce. So the `&id?unbox=key` private blob id should be the same each time the same file is added as a private blob. It will be different from if the same file is added as an unencrypted blob of course. But you could use the id of an unencrypted blob in a private message by copying it in manually, such as to reuse a blob already on the network.

